import React, { Component } from 'react';

class Hello extends Component {
	State = {
		contacts: [],
	}
	componentDidMount() {
		fetch('http://snapi.epitech.eu.')
		.then(res => res.json())
		.then((data) => {
			this.setState({ contacts : data});
			console.log(data);
		})
		.catch(console.log);
	}
	render(){
  return (
    <div className="Content">
      <h1> Hello </h1>
    </div>
  );
}
}
export default Hello;
